import React from "react";
function Testing(props){
    return(
        <div>
            <p>
                Fist name:{props.Fname}<br/>
                Last name:{props.Lname}<br/>
                City name:{props.City}<br/>
            </p>

        </div>
    )
}
function Testing1(){
    return(
        <div>
            <h3>Yakkaluru Family Details</h3>
            <Testing Fname="naveen" Lname="Yakkaluru" City="Tadiparti"/>
        </div>
    )
}
export default Testing1;
